import ExpenseItem from "./components/ExpenseItem";

function App() {
  let expenses = [
    { id:'e1', title: "Car Insurance", amount: 294.67, date: new Date(2021, 2, 28) },
    { id:'e2', title: "New Books", amount: 94.88, date: new Date(2021, 3, 1) },
    { id:'e3', title: "Kitchen Accessories", amount: 200.50, date: new Date(2021, 3, 10) },
    { id:'e4', title: "Utility Bills", amount: 690.00, date: new Date(2021, 3, 15) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title = {expenses[0].title} amount = {expense[0].amount} date = {expenses[0].date}></ExpenseItem>
      <ExpenseItem title = {expenses[1].title} amount = {expense[1].amount} date = {expenses[1].date}></ExpenseItem>
      <ExpenseItem title = {expenses[2].title} amount = {expense[2].amount} date = {expenses[2].date}></ExpenseItem>
      <ExpenseItem title = {expenses[3].title} amount = {expense[0].amount} date = {expenses[0].date}></ExpenseItem>
    </div>
  );
}

export default App;
